import { Carousel, Row, Col } from 'antd';
const Index = () => {
  return (
    <Row justify="space-around" type="flex">
      <Col span={24} className="carousel mb-50">
        <Carousel autoplay>
          <div >
            <h3>
              <img src="/static/images/12.jpg" />
            </h3>
          </div>
        </Carousel>
      </Col>
    </Row>
  )
}

